function intersection(set1, set2) {
    var myArray = [];
    var k = 0;
    for (var i = 0; i < set1.length; i++) {
        for (var j = 0; j < set2.length; j++) {
            if (set1[i] === set2[j]) {
                myArray[k] = set1[i];
                k++;
            }
        }
    }
    return myArray;
}
module.exports = intersection;